                    ? nums_1.length - 1
                    : bombIndex + bombPower;
            const sliced = nums_1.slice(leftIndex, rightIndex + 1);
            const elemToRemove = sliced.length;
            nums_1.splice(leftIndex, elemToRemove);
        }
    }

    const sum = nums_1.reduce((acc, val) => acc + val);
    return sum;
}

